import React from 'react'
import s from './gallery.module.scss'
import { GalleryItem } from './components/GalleryItem/GalleryItem'

const Gallery = () => {
	return (
		<div className={s.gallery}>
			<GalleryItem />
			<GalleryItem />
			<GalleryItem />
			<GalleryItem />
		</div>
	)
}

export { Gallery }
